window.bookSummaryJSON = "<p>Having arrived at the Order of the Malefic Viper, Jake is eager to improve his alchemy....<br> <br> However, reality can often be cruel. Because while trying to do just that, Jake will be dealing with the political landscape of the Order. Between hiding his identity as the Chosen of the Big Boss, being forced to attend get-togethers, visiting vampires to sell ancient memorabilia, and trying to actually learn some alchemy, Jake's busier than ever.<br> <br> Earth also still calls. There, he helps friends deal with family issues by going on a nice road trip with Carmen and Sylphie. On the way, he can hopefully find time to hunt down the final Primas he needs—powerful monsters with unique key fragments—to participate in the upcoming system event dubbed the Seat of the Exalted Prima.<br> <br> An event that hopefully—no, certainly—won’t have any unforeseen Bloodline-induced shenanigans.<br> <br> Definitely not.<br> Book 7 of the hit Primal Hunter LitRPG series is here. Grab your copy today!<br> <b> <br> About the Series:</b> Experience an Apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of progression fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities. Witness as he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
